import React from 'react'
import search from '../assets/search.svg'
import pinterest from '../assets/pinterest.svg'
import view_thumbnail from '../assets/view_thumbnail.svg'
import view_uneven from '../assets/view_uneven.svg'
import view_detailed from '../assets/view_detailed.svg'
import { TextField, OutlinedInput, IconButton, InputAdornment } from '@mui/material'
import { withStyles, makeStyles } from '@mui/styles'

const useStyles = makeStyles(theme => ({
    root: {
        display: "flex",
        flexWrap: "wrap"
    },
    margin: {
        margin: theme.spacing(1)
    },
    textField: {
        width: 200,
        "&:hover .MuiInputLabel-root": {
            color: theme.palette.text.primary
        },
        "& .Mui-focused.MuiInputLabel-root": {
            color: theme.palette.primary.main
        }
    },
    outlinedInput: {
        "&:hover .MuiInputAdornment-root .MuiSvgIcon-root": {
            color: theme.palette.text.primary
        },
        "&.Mui-focused .MuiInputAdornment-root .MuiSvgIcon-root": {
            color: theme.palette.primary.main
        }
    }
}));

export default function Header() {
    return (
        <div className='Header'>
            <img src={pinterest} alt="pinterest" id='appicon' />
            <OutlinedInput id="outlined-basic" label="Search" variant="outlined"
                InputProps={{
                    endAdornment: <img src={search} />
                }} />
        </div>
    )
}
